import react from "react";
import NavBar from "./MyProjects/InstagramClone/Navigation/NavBar";
import FollowerStory from "./MyProjects/InstagramClone/Story/FollowerStory";
import Suggestion from "./MyProjects/InstagramClone/SuggestionBar/Suggetstion";
import Post from "./MyProjects/InstagramClone/AllPost/Post";

const App = () => {
    return (
        <react.Fragment>
                <NavBar />
                <div className="instgram" style={{backgroundColor:'aliceblue;'}}>
                    <div className="flexcontent" style={{ display: 'flex', justifyConteny: 'center', alignItem: 'center',flexWrap:'wrap', position:'relative' }}>
                        <FollowerStory />
                        <Suggestion/>
                        <Post/>
                    </div>
                </div>
        </react.Fragment>
    );
}
export default App;
